criteria.textblock:
Inclusion Criteria:

          -  A person is eligible for inclusion in the study if he/she:

               1. Is at least 17 years of age and has full legal capacity to volunteer;

               2. Has read and signed an information consent letter;

               3. Is willing and able to follow instructions and maintain the appointment
                  schedule;

               4. Is correctable to a visual acuity of 20/30 or better (in each eye) with their
                  habitual correction and the assigned study lenses;

               5. Has astigmatism less than or equal to -1.00D;

               6. Is an adapted soft contact lens wearer;

               7. Demonstrates an acceptable fit with the study lenses;

               8. Has no active anterior segment disease or known ocular disease.

                  Exclusion Criteria:

        A person will be excluded from the study if he/she:

          1. Has never worn contact lenses before;

          2. Has any systemic disease affecting ocular health;

          3. Is using any systemic or topical medications that will affect ocular health;

          4. Has any ocular pathology or severe insufficiency of lacrimal secretion (moderate to
             severe dry eyes) that would affect the wearing of contact lenses;

          5. Has persistent, clinically significant corneal or conjunctival staining using sodium
             fluorescein dye;

          6. Has any clinically significant lid or conjunctival abnormalities, neovascularization,
             corneal scars or corneal opacities;

          7. Is aphakic;

          8. Has undergone corneal refractive surgery;

          9. Is participating in any other type of clinical or research study;

         10. Has known sensitivity to the diagnostic pharmaceuticals to be used in the study.
